import React from 'react';

const BlogPost = ( prop ) => {
	console.log(prop)

    let post;
    if (prop != undefined) {
        post = prop.title;
    } else {
    	post = null;
    }

	return (

      <div>

      <h1> {post.title} title</h1>

      </div>

	);
}

export default BlogPost;
